import React from "react";
import styled from "styled-components";

import StuCircle from "../atoms/StuCircle";
import { StudProvider } from "../../Context/StudProvider";
import Size from "../../Size";

const ButtonBox = styled.span`
width: 105.23px;
height: 24px;
padding-left: 0%;
margin-top: 684px;
background: green; 
`;

const StudBox = styled.div`
  width: 848px;
  padding-top: 72px;
  padding-left: 12.56015625%;
  @media screen and ${Size.device.tablet} {
    width: 608px;
    padding-top: 56px;
    padding-left: 0%;
  }
  @media screen and ${Size.device.moblie} {
    width: 303px;

    padding-top: 54px;
    padding-left: 0%;
  }
`;



function Student() {
  return (
    <>
    <ButtonBox />
    <StudBox>
      <StudProvider>
        <StuCircle />
      </StudProvider>
    </StudBox>
    </>
  );
}

export default Student;
